contracts/JamToken.sol.content:
// Smart Contract en donde se realizara staking (generación de los tokens)
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract JamToken {

    uint256 public totalSupply = 1000000000000000000000000;
    string public name = "DANI Token";
	string public symbol = "DAN";  // token symbol
    uint256 public decimals = 18;

    // Evento para la transferencia de tokens de un usuario
    event Transfer (
        address indexed _from,
        address indexed _to,
        uint256 _amount
    );

    // Evento para la aprobacion de un operador
    event Approval (
        address indexed _owner,
        address indexed _approved,
        uint256 _amount  // valor que fue transferido al contrato
    );

    // Estructuras de datos
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowances;  // esto es un mapeo para almacenar un valor booleano, el valor booleano indica si el usuario tiene permitido o no el uso del token
    
	constructor() {
        balanceOf[msg.sender] = totalSupply;
    }
    
	
	// Función para transferir Tokens al contrato
	function transfer(address _to, uint256 _amount) external returns(bool success){
        require(_to != address(0), "Invalid address");  // validar si el contrato es valido o no 
        require(_amount > 0, "Invalid amount");  // validar si el contrato es valido o no 
        require(balanceOf[msg.sender] >= _amount, "Not enough balance");  // validar si el contrato es valido o no         
        require(balanceOf[_to] + _amount <= totalSupply, "Exceeds the total supply");  // validar si el contrato es valido o no 
        
        balanceOf[msg.sender] -= _amount;  // restar el valor del contrato
        balanceOf[_to] += _amount;  // sumar el valor del contrato
        
        emit Transfer(msg.sender, _to, _amount);  // emitir un evento para informar a la cadena de bloques que el contrato transferio Tokens a otro contrato
        return true;  // retornar que el contrato fue exitoso 
	}  // fin de la función transfer()
	
    // Funcion para transferir tokens desde una dirección concreta
    function transferFrom(address _from, address _to, uint256 _amount ) external returns(bool success){
        require(balanceOf[_from] >= _amount, "Not enough balance");  // validar que tenga suficientes tokens 
        require(_from != address(0), "Invalid address");  // validar si la dirección origen es valida 
        require(_to != address(0), "Invalid address");  // validar si la dirección destino es valida
        require(_amount > 0, "Invalid amount");  // validar si el valor es mayor de 0 
        require(allowances[_from][msg.sender] >= _amount, "Not enough balance");  // validar si el valor permitido es mayor o igual al valor que tiene el contrato
        require(balanceOf[_to] + _amount <= totalSupply, "Exceeds the total supply");  // validar si el valor no sobrepasa el valor máximo permitido para el token
        
        balanceOf[_from] -= _amount;   // restar el valor del contrato 
        balanceOf[_to] += _amount;   // sumar el valor del contrato 
        allowances[_from][msg.sender] -= _amount;   // restar el valor del contrato con el que puede manejar
        
        emit Transfer(_from, _to, _amount);  // emitir un evento para informar a la cadena de bloques que el contrato transferio Tokens a otro contrato 
        return true;   // retornar que el contrato fue exitoso
    } // Fin de la funcion transferFrom()

	// Función para aprobar el uso del contrato 
	function approve(address _spender, uint256 _amount) external returns(bool success){
        require(_spender != address(0), "Invalid address");  // validar si el contrato es valido o no 
        require(_amount > 0, "Invalid amount");  // validar si el contrato es valido o no 
        require(balanceOf[msg.sender] >= _amount, "Not enough balance");  // validar si el contrato es valido o no 
        require(balanceOf[_spender] + _amount <= totalSupply, "Exceeds the total supply");  // validar si el contrato es valido o no 
        
        allowances[msg.sender][_spender] = _amount;  // almacenar la cantidad del contrato    
        emit Approval(msg.sender, _spender, _amount);  // emitir un evento para informar a la cadena de bloques que el contrato aprobó el uso del contrato 
        return true;  // retornar que el contrato fue exitoso 
	}  // fin de la función approve()
}

